                "title": "茜茜公主（系列）",
                "overview": "《茜茜公主》（Sissi）是恩斯特·马里施卡（Ernst Marischka）执导的奥地利爱情电影，由罗密·施奈德（Romy Schneider）、卡尔海因茨-伯姆主演。系列共有三部影片，还包括《年轻的皇后》和《皇后的命运》。这部影片讲述了活泼可爱的茜茜公主和弗朗茨皇帝两人一见钟情，并且不畏严苛的皇太后追求真爱的故事。影片于1955年12月首映；1988年由上海电影译制片厂引进中国。",
