        {
            "iso_3166_1": "US",
            "iso_639_1": "en",
            "name": "English",
            "english_name": "English",
            "data": {
                "homepage": "http://movies.disney.com/finding-nemo",
                "overview": "Nemo, an adventurous young clownfish, is unexpectedly taken from his Great Barrier Reef home to a dentist's office aquarium. It's up to his worrisome father Marlin and a friendly but forgetful fish Dory to bring Nemo home -- meeting vegetarian sharks, surfer dude turtles, hypnotic jellyfish, hungry seagulls, and more along the way.",
                "runtime": 100,
                "tagline": "There are 3.7 trillion fish in the ocean. They're looking for one.",
                "title": ""
            }
        },
        {
            "iso_3166_1": "DE",
            "iso_639_1": "de",
            "name": "Deutsch",
            "english_name": "German",
            "data": {
                "homepage": "",
                "overview": "Im Schutze eines großen Riffs lebt die Familie von Clownfisch Marlin relativ sicher und trotzdem werden seine Frau und nahezu alle seine Kinder Opfer eines gefräßigen Räubers. Das einzige ihm verbleibende Kind ist der kleine Nemo, der von da an besonders behütet wird. Doch die Neugier ist zu groß und prompt wird Nemo gefangen und zu den Menschen als Zierfisch gebracht. Durch ein paar Möwen erfährt Marlin alsbald, wo Nemo gelandet ist: im Aquarium eines Zahnarztes in Sydney. Mutig macht sich der Clownfisch mit seiner Freundin Dorie, die allerdings ständig an Gedächtnisverlust leidet, auf den Weg dorthin, vorbei an Haien, Quallen und anderen Gefahren. Währenddessen ist Nemo nicht untätig und plant mit den anderen Aquariumsfischen einen gewagten Ausbruch aus ihrem Gefängnis.",
                "runtime": 100,
                "tagline": "",
                "title": "Findet Nemo"
            }
        },
        {
            "iso_3166_1": "FR",
            "iso_639_1": "fr",
            "name": "Français",
            "english_name": "French",
            "data": {
                "homepage": "http://movies.disney.com/finding-nemo",
                "overview": "Nemo, un jeune poisson-clown intrépide est capturé puis plongé dans l'aquarium d'un cabinet dentaire. Marin, son père, et Dory, un poisson-chirurgien bleu sympathique mais tête-en-l'air, entament un long périple pour le retrouver. Ils croiseront en chemin une éclectique faune tropicale plus ou moins bien intentionnée. Sauront-ils retrouver la piste de Nemo ?",
                "runtime": 101,
                "tagline": "71% de la surface du globe est constituée d'eau. C'est vaste, pour retrouver un poisson !",
                "title": "Le Monde de Nemo"
            }
        },
        {
            "iso_3166_1": "IT",
            "iso_639_1": "it",
            "name": "Italiano",
            "english_name": "Italian",
            "data": {
                "homepage": "http://movies.disney.com/finding-nemo",
                "overview": "Una covata di pesci pagliaccio viene distrutta dall'attacco di un feroce barracuda. Sopravvivono solamente il papà, Marlin, e un unico piccolo che viene chiamato Nemo. Il pesciolino ha una pinna atrofizzata e il padre è iperapprensivo nei suoi confronti al punto di desiderare che l'inizio della scuola venga ritardato. Un giorno però Nemo viene catturato da un dentista appassionato di pesca subacquea e l'acquario sarà la sua prigione. Marlin deve quindi vincere tutti i suoi timori per ritrovarlo. Verrà aiutato da Dory, una pesciolina simpaticamente smemorata.",
                "runtime": 100,
                "tagline": "Ci sono 3,7 trilioni di pesci nell'oceano. Ne stanno cercando uno.",
                "title": "Alla ricerca di Nemo"
            }
        },
        {
            "iso_3166_1": "RU",
            "iso_639_1": "ru",
            "name": "Pусский",
            "english_name": "Russian",
            "data": {
                "homepage": "",
                "overview": "Среди прекрасных тропических морских стихий, в районе Большого барьерного рифа в уединении живет рыба-клоун по имени Марлин. Он растит своего единственного сыночка Немо. Океан и существующие в нем опасности очень страшат Марлина, и он как может ограждает сына от них, но молодой Немо, страдающий излишним любопытством, очень хочет разузнать побольше о таинственном рифе, рядом с которым они живут. Когда Немо по иронии судьбы оказывается вдалеке от дома, да и еще сталкивается с угрозой стать обедом рыбы-танка, Марлин отправляется на поиски сына. Но Марлин, конечно же, понимает, что героический спасатель из него не получится и просит о помощи в поисках, Дори, королевскую синюю рыбу, которая хоть и страдает от того, что почти ничего не помнит, но добрее ее не отыскать во всем безбрежном океане! Итак, наши герои отправляются в путешествие, в котором их подкарауливают многочисленные трудности и опасности...",
                "runtime": 96,
                "tagline": "В океане 3,7 триллиона рыб. Они ищут одну",
                "title": "В поисках Немо"
            }
        },
        {
            "iso_3166_1": "NL",
            "iso_639_1": "nl",
            "name": "Nederlands",
            "english_name": "Dutch",
            "data": {
                "homepage": "",
                "overview": "De clownvis Marlin leidt samen met zijn enige zoon Nemo een veilig leventje in het Great Barrier Reef bij Australië. Wanneer Nemo onverwachts weggehaald wordt van zijn thuis, en in het aquarium van een tandarts belandt, is het aan Marlin om hem te redden.",
