            "english_name": "Swedish",
            "data": {
                "homepage": "",
                "overview": "Möt Nemo, en ung och nyfiken clownfisk som fångas av en sportdykare och hamnar i ett akvarium på en tandläkarmottagning i Sydney. Nu är det upp till Marvin, Nemos ängslige pappa att rädda honom! Han får sällskap av den hjälpsamma men väldigt glömska fisken Doris och tillsammans ger de sig ut i det stora farliga havet. Längs vägen tvingas de ta sig förbi skräckinjagande hajar, surfande sköldpaddor, lömska brännmaneter, hungriga fiskmåsar och mycket mer.",
                "runtime": 101,
