                "homepage": "",
                "overview": "Az élet a Nagy Zátony környékén tele van veszélyekkel. Jól tudja ezt Pizsi, a kis bohóchal, s erre próbálja megtanítani egyetlen fiát, Némót is. Ám az ifjonc - ahogy az már lenni szokott - tele van kalandvággyal, és amikor eljön az idő, el kell hagynia otthonát, és elindulni az iskolába. Pizsi idegesen kíséri őt, és szorongva figyeli minden mozdulatát. Aggodalma nem is alaptalan, mert Némó, dacolva intelmeivel, túlúszik a biztonságos határon, hogy megnézzen egy hajót, és az apa tehetetlenül nézi végig, ahogy egy búvár hirtelen elragadja csemetéjét.",
