            "name": "English",
            "english_name": "English",
            "data": {
                "name": "",
                "overview": "The series focuses on an eccentric motley crew that is the Smith family and their three housemates: Father, husband, and breadwinner Stan Smith; his better half housewife, Francine Smith; their college-aged daughter, Hayley Smith; and their high-school-aged son, Steve Smith. Outside of the Smith family, there are three additional main characters, including Hayley's boyfriend turned husband, Jeff Fischer; the family's man-in-a-goldfish-body pet, Klaus; and most notably the family's zany alien, Roger, who is \"full of masquerades, brazenness, and shocking antics.\"",
                "homepage": "",
                "tagline": "From the creator of \"Family Guy\" comes a man who will stop at nothing to protect his country."
            }
        },
        {
            "iso_3166_1": "DE",
            "iso_639_1": "de",
            "name": "Deutsch",
            "english_name": "German",
            "data": {
                "name": "American Dad",
                "overview": "Stan Smith ist ein echter Vorzeigeamerikaner. Als Waffenexperte bei der CIA immer auf den Fall eines terroristischen Anschlags vorbereitet, würde er alles dafür tun, sein geliebtes Vaterland zu beschützen. Neben seiner Tätigkeit bei der CIA ist er vor allem eins: Familienmensch. Dem Anschein nach sind die Smiths also eine ganz normale Familie, wären da neben dem pubertierenden Sohn Steve und der ultra-liberalen Tochter Hayley nicht noch die Familienmitglieder Roger und Klaus. Roger, ein Alien, wurde von Stan einst aus der Area 51 vor dem sicheren Tod gerettet, und Klaus ist ein deutsch-sprechender Goldfisch – ein missglücktes Experiment aus den CIA-Labors.",
