                "name": "American Dad!",
                "overview": "Animação do mesmo criador de \"Family Guy\" (Seth McFarlane). Stan Smith (McFarlane) trabalha para a CIA e está sempre preparado para combater terroristas. Mas leva seu trabalho de proteger o país tão a sério que costuma detonar a torradeira cada vez que ela faz um barulho. Ao lado de sua mulher e de seus filhos, Stan também abriga em sua casa Roger, um alienígena sarcástico resgatado da Área 51, e Klaus, um peixe experimental da CIA.",
