                "overview": "American Dad! on Seth MacFarlanen, Mike Barkerin ja Matt Weitzmanin luoma yhdysvaltalainen satiirinen piirrossarja.\n\nAmerican Dad keskittyy CIA-agentti Stan Smithin ja hänen perheensä elämään.",
