            "english_name": "Mandarin",
            "data": {
                "name": "美国老爹",
                "overview": "斯坦·史密斯是一名驻扎在弗吉尼亚州兰利瀑布城的中央情报局特工，是一名无可争议的武器专家和自豪的热爱家人的男人。斯坦一直对恐怖活动保持警惕，为了保护他心爱的美国和警戒祖国的安全，他会采取极端行为。只要看看他冰箱上的恐怖警报仪，以及每当吐司弹出时他就要对着烤面包机开枪的即时反应就知道了。",
                "homepage": "",
                "tagline": ""
            }
