            "name": "ελληνικά",
            "english_name": "Greek",
            "data": {
                "name": "",
                "overview": "Μια σειρά κινουμένων σχεδίων που ακολουθεί τον Σταν Σμιθ, έναν πράκτορα της CIA στο Λάνγκλεϊ Φολς της Βιρτζίνια, του οποίου κύριος στόχος στη ζωή είναι η εθνική ασφάλεια. Η οικογένειά του, ένα χρυσόψαρο που μιλάει και ένας εξωγήινος που έσωσε από την Περιοχή 51 κρατούν τον Σταν απασχολημένο, καθώς προσπαθεί να αποτρέψει τρομοκρατικές ενέργειες στις ΗΠΑ.",
