        {
            "iso_3166_1": "HU",
            "iso_639_1": "hu",
            "name": "Magyar",
            "english_name": "Hungarian",
            "data": {
                "name": "Amerikai fater",
                "overview": "A sorozat főszereplője Stan Smith (Seth MacFarlane), aki mint a CIA fegyverszakértője és mint büszke családapa éli mindennapjait, és óvja országát a terrorizmustól a virginiai Langley Fallsban. Stan felesége, a kedves Francine (Wendy Schaal), aki konzervatív férje kedvéért teljesen elnyomta egykori kicsapongó énjét. Stan folyamatos összeütközésben van ultraliberális 18 éves lányával, Hayley-vel (Rachael MacFarlane), akit arra kényszerít, hogy haladjon át egy repülőtérire emlékeztető biztonsági kapun, akárhányszor hazatér a helyi egyetemről, ahol a lány feminista jogokat tanul. Hayley 13 éves öccse, a boldogtalan és szerencsétlen Steve (Scott Grimes) még a pubertáskor határán lépdel, de alapvetően vesztes alkat. A Smith-ház még két különös lakót tartogat a nézők számára: itt van Roger (ugyancsak Seth MacFarlane), a szarkasztikus földönkívüli, akit Stan ?megszöktetett? az 51-es körzetből, azóta a család nyakán lóg, és Klaus (Dee Bradly Baker), egy aranyhal. Klaus hajdan NDK-s sportoló volt, akinek az agyát a CIA átültette egy aranyhalba, hogy megakadályozzák győzelmét az olimpián. Ez a radikálisan különböző személyiségekkel megtöltött család csak megpróbál utat találni a kölcsönös szeretethez és megbecsüléshez ebben a krízisekkel teli, stresszes világban. A sorozat humoros formában közelíti meg az Amerikai Egyesült Államokban uralkodó társadalmi igazságtalanságot, és a néha túlzó patrióta, republikánus és liberális eszméket.",
                "homepage": "",
                "tagline": ""
            }
        },
        {
