            "english_name": "Russian",
            "data": {
                "name": "Американский папаша!",
                "overview": "Агент ЦРУ Стэн Смит постоянно отбивается от террористов, угрожающих безопасности США (иногда принося больше вреда, чем пользы). Его жена Франсин — обычная домохозяйка с двумя детьми: Хейли, обычный бунтующий подросток, и Стив, компьютерщик, который любит «Подземелья и драконы», игры и комиксы. Ещё есть Роджер, нелегальный (космический) пришелец, которого Смиты защищают. И последнее, но не менее важное: это остроумная говорящая рыба Смитов Клаус — на самом деле, мозг у рыбки — человеческий  и его много лет назад ЦРУ извлекло из человеческого тела.",
