            "name": "English",
            "english_name": "English",
            "data": {
                "name": "",
                "overview": "From the delightfully twisted creative minds behind 'Family Guy' comes 'American Dad', the animated tour de force featuring CIA operative Stan Smith, his outrageous family and Roger, the alcoholic extraterrestrial who lives with them! Follow the adventures of the Smiths from the California desert, where Stan's wife, Francine, relives her teenage years at the Burning Man festival, to Saudi Arabia, where the entire family is sentenced to death by the Vice and Virtue Police! Whether it's rigging elections, erasing memories, casing sleazy strip clubs, or staging \"bum fights\", it's all in a day's work for Stan, and it's all here in the side-splittingly hilarious first season of 'American Dad'!"
            }
        },
        {
            "iso_3166_1": "DE",
            "iso_639_1": "de",
            "name": "Deutsch",
            "english_name": "German",
            "data": {
                "name": "",
                "overview": "Von den entzückend verdrehten kreativen Köpfen hinter „Family Guy“ kommt „American Dad“, die animierte Tour de Force mit dem CIA-Agenten Stan Smith, seiner unerhörten Familie und Roger, dem alkoholkranken Außerirdischen, der bei ihnen lebt! Folgen Sie den Abenteuern der Smiths von der kalifornischen Wüste, wo Stans Frau Francine ihre Teenagerjahre beim Burning Man Festival noch einmal durchlebt, bis nach Saudi-Arabien, wo die ganze Familie von der Vice and Virtue Police zum Tode verurteilt wird! Ob es darum geht, Wahlen zu manipulieren, Erinnerungen zu löschen, anrüchige Stripclubs zu verkleiden oder „Penkerkämpfe“ zu inszenieren, für Stan ist das alles ein Tagesgeschäft, und das alles hier in der unglaublich urkomischen ersten Staffel von „American Dad“!"
            }
