                "overview": "Stan finds Deputy Director Bullock, his supervisor, starting a relationship with Hayley. However, he can't risk saying or doing anything about it because he's up for a promotion at the CIA. Meanwhile, Steve finds Dick Cheney's BlackBerry and uses the contact numbers to play pranks on political figures from around the world."
